//  Custom bottom navigation component with flexible layout options
//

import SwiftUI

// MARK: - Tab Item Data
struct TabItemData: Identifiable {
    let id = UUID()
    let label: String
    let icon: String
    let action: () -> Void
}

// MARK: - Custom Bottom Navigation
/// A custom bottom navigation bar that supports flexible layouts:
/// - Left-justified tabs with optional right-aligned item
/// - Standard full-width distribution
struct CustomBottomNavigation: View {
    let leftTabs: [TabItemData]
    let rightTab: TabItemData?
    let accentColor: Color
    @Binding var selectedIndex: Int

    init(
        leftTabs: [TabItemData],
        rightTab: TabItemData? = nil,
        selectedIndex: Binding<Int>,
        accentColor: Color
    ) {
        self.leftTabs = leftTabs
        self.rightTab = rightTab
        self._selectedIndex = selectedIndex
        self.accentColor = accentColor
    }

    var body: some View {
        HStack(spacing: 0) {
            // Left-justified tabs
            HStack(spacing: 8) {
                ForEach(Array(leftTabs.enumerated()), id: \.element.id) { index, tab in
                    Button {
                        HapticManager.shared.selection()
                        selectedIndex = index
                        tab.action()
                    } label: {
                        VStack(spacing: 4) {
                            Image(systemName: tab.icon)
                                .font(.system(size: 24))
                            Text(tab.label)
                                .font(.caption2)
                        }
                        .frame(maxWidth: .infinity)
                        .foregroundStyle(selectedIndex == index ? accentColor : .secondary)
                    }
                }
            }

            // Spacer to push right tab to the right
            if rightTab != nil {
                Spacer()
            }

            // Right-aligned tab
            if let rightTab = rightTab {
                Button {
                    HapticManager.shared.selection()
                    selectedIndex = leftTabs.count
                    rightTab.action()
                } label: {
                    VStack(spacing: 4) {
                        Image(systemName: rightTab.icon)
                            .font(.system(size: 24))
                        Text(rightTab.label)
                            .font(.caption2)
                    }
                    .frame(width: 80)
                    .foregroundStyle(selectedIndex == leftTabs.count ? accentColor : .secondary)
                }
            }
        }
        .padding(.horizontal, 16)
        .padding(.top, 8)
        .padding(.bottom, 20)
        .background {
            Rectangle()
                .fill(.ultraThinMaterial)
                .ignoresSafeArea(edges: .bottom)
        }
    }
}

#Preview {
    VStack {
        Spacer()

        CustomBottomNavigation(
            leftTabs: [
                TabItemData(label: "Profile", icon: "person.circle.fill", action: {}),
                TabItemData(label: "Feed", icon: "house.fill", action: {}),
                TabItemData(label: "Messages", icon: "message.fill", action: {})
            ],
            rightTab: TabItemData(label: "Search", icon: "magnifyingglass", action: {}),
            selectedIndex: .constant(0),
            accentColor: .blue
        )
    }
}

