Based on the article, here's an example of creating toolbar groups with Liquid Glass appearance:

```swift
struct ToolsToolbar: ToolbarContent {
    var body: some ToolbarContent {
        ToolbarItem(placement: .cancellationAction) {
            Button("Cancel", systemImage: "xmark") {}
        }

        ToolbarItemGroup(placement: .primaryAction) {
            Button("Draw", systemImage: "pencil") {}
            Button("Erase", systemImage: "eraser") {}
        }

        ToolbarSpacer(.flexible)

        ToolbarItem(placement: .confirmationAction) {
            Button("Save", systemImage: "checkmark") {}
        }
    }
}
```

Key points about the new toolbar approach:
- Use `ToolbarItemGroup` to group related actions
- Utilize `ToolbarSpacer(.flexible)` to create space between groups
- Prefer symbol-based buttons with both images and text
- Use `ToolbarItemPlacement` to control styling and positioning

The article emphasizes that these changes are part of Apple's "Liquid Glass" design language, which introduces a more modern, glassy appearance to toolbars across platforms.

