import SwiftUI

struct ProfileView: View {
    @Environment(\.designTheme) private var theme
    @State private var currentUser = User.currentUser
    @State private var showingGoLive = false
    @State private var showingPrivacySettings = false

    var body: some View {
        NavigationStack {
            GeometryReader { geo in
                ZStack {
                    // Background photo - constrained to screen bounds
                    Image(currentUser.profileImageName)
                        .resizable()
                        .aspectRatio(contentMode: .fill)
                        .frame(width: geo.size.width, height: geo.size.height)
                        .clipped()
                        .accessibilityHidden(true)

                    // Gradient overlay
                    LinearGradient(
                        gradient: Gradient(colors: [
                            Color.clear,
                            theme.color(.foreground).opacity(0.65)
                        ]),
                        startPoint: UnitPoint(x: 0.5, y: 0.55),
                        endPoint: .bottom
                    )

                    // Content - Vertical icon navigation with liquid glass container
                    VStack {
                        Spacer()

                        // Vertical navigation toolbar with liquid glass appearance
                        VStack(spacing: .spacing2) {
                            NavigationLink(destination: AboutView()) {
                                Image(systemName: "person.fill")
                                    .font(.system(size: 20))
                                    .foregroundStyle(.white)
                                    .frame(width: 44, height: 44)
                            }
                            .accessibilityLabel("About")

                            NavigationLink(destination: AthleticsView()) {
                                Image(systemName: "figure.run")
                                    .font(.system(size: 20))
                                    .foregroundStyle(.white)
                                    .frame(width: 44, height: 44)
                            }
                            .accessibilityLabel("Athletics")

                            NavigationLink(destination: AcademicsView()) {
                                Image(systemName: "book.fill")
                                    .font(.system(size: 20))
                                    .foregroundStyle(.white)
                                    .frame(width: 44, height: 44)
                            }
                            .accessibilityLabel("Academics")

                            NavigationLink(destination: FilmView()) {
                                Image(systemName: "video.fill")
                                    .font(.system(size: 20))
                                    .foregroundStyle(.white)
                                    .frame(width: 44, height: 44)
                            }
                            .accessibilityLabel("Film")

                            NavigationLink(destination: PostsView()) {
                                Image(systemName: "pencil")
                                    .font(.system(size: 20))
                                    .foregroundStyle(.white)
                                    .frame(width: 44, height: 44)
                            }
                            .accessibilityLabel("Posts")
                        }
                        .padding(.vertical, .spacing3)
                        .padding(.horizontal, .spacing2)
                        .background(.ultraThinMaterial.opacity(0.3))
                        .clipShape(Capsule())
                        .frame(maxWidth: .infinity, alignment: .trailing)
                        .padding(.trailing, .spacing4)

                        Spacer()
                    }
                }
                .ignoresSafeArea()
            }
            .overlay(
                HStack(spacing: .spacing4) {
                    Spacer()
                    Button(action: {
                        showingPrivacySettings = true
                    }) {
                        Image(systemName: "gearshape.fill")
                            .foregroundStyle(.white)
                            .font(.system(size: 20))
                            .frame(width: 44, height: 44)
                    }
                    .background(.ultraThinMaterial.opacity(0.3))
                    .clipShape(Circle())
                    .accessibilityLabel("Settings")
                    .accessibilityHint("Open privacy and account settings")
                }
                .padding(.horizontal, .spacing5)
                .padding(.top, 50)
                , alignment: .top
            )
            .sheet(isPresented: $showingPrivacySettings) {
                PrivacySettingsView(privacySettings: $currentUser.privacySettings)
            }
        }
        .withDesignTheme()
    }
}

