//

import SwiftUI

// MARK: - Athlete Tab View
struct AthleteTabView: View {
    @State private var showingGoLive = false

    var body: some View {
        ZStack {
            TabView {
                Tab("Profile", systemImage: "person.circle.fill") {
                    ProfileView()
                }

                Tab("Feed", systemImage: "house.fill") {
                    AthleteFeedView()
                }

                Tab("Messages", systemImage: "message.fill") {
                    MessagesView()
                }

                Tab("Search", systemImage: "magnifyingglass", role: .search) {
                    AthleteSearchView()
                }
            }
            .tint(.black)
            .toolbarBackground(.clear, for: .tabBar)
            .onAppear {
                let appearance = UITabBarAppearance()
                appearance.configureWithTransparentBackground()
                appearance.backgroundColor = UIColor.white.withAlphaComponent(0.1)

                // Selected icon color
                appearance.stackedLayoutAppearance.selected.iconColor = .black
                appearance.stackedLayoutAppearance.selected.titleTextAttributes = [.foregroundColor: UIColor.black]

                // Unselected icon color
                appearance.stackedLayoutAppearance.normal.iconColor = .white
                appearance.stackedLayoutAppearance.normal.titleTextAttributes = [.foregroundColor: UIColor.white]

                UITabBar.appearance().standardAppearance = appearance
                UITabBar.appearance().scrollEdgeAppearance = appearance
            }
            .userTypeThemed(.athlete)

            // Vertical toolbar with Go Live button above Search tab area
            VStack {
                Spacer()

                HStack {
                    Spacer()

                    VStack(spacing: .spacing2) {
                        // Go Live button
                        Button(action: {
                            showingGoLive = true
                        }) {
                            Image(systemName: "video.fill")
                                .font(.system(size: 20))
                                .foregroundStyle(.white)
                                .frame(width: 44, height: 44)
                        }
                        .accessibilityLabel("Go live")
                    }
                    .padding(.vertical, .spacing2)
                    .padding(.horizontal, .spacing2)
                    .background(.ultraThinMaterial.opacity(0.3))
                    .clipShape(Capsule())
                    .padding(.trailing, .spacing4)
                    .padding(.bottom, 90) // Position above tab bar
                }
            }
        }
        .sheet(isPresented: $showingGoLive) {
            GoLiveView()
        }
    }
}

